import logo from './logo.svg';
import './App.css';

import landingImage from './images/landing-photo.png '

import mailLogo from './images/mail-logo.svg';
import linkedinLogo from './images/linkedin-logo.svg';
import githubLogo from './images/github-logo.svg';

function App() {
  return (
    <div className="App">

      <div className="landing-left">

        {/* Navbar */}
        <div className="navbar">
          <div className="logo">Dre</div>
          <ul>
            <li>What I Do</li>
            <li>Projetcs</li>
            <li>About Me</li>
          </ul>
        </div>

        {/* Landing Page */}
        <div className="landingPage">
          <div className="user-first-shadow">User First</div>
          <div className="slogan">User First Web Application to fit Your Needs.</div>
        </div>

      </div>

      <div className="landing-right">
        <ul>
          <li><img src={mailLogo} alt="mail-logo"></img></li>
          <li><img src={linkedinLogo} alt="mail-logo"></img></li>
          <li><img src={githubLogo} alt="mail-logo"></img></li>
        </ul>
      </div>










    </div>
  );
}

export default App;
